def find_player(name):
    """Find a player by name (handles partial matches and nicknames)."""
    name_lower = name.lower().strip()
    nicknames = {
        "jsn": "Jaxon Smith-Njigba", "kw3": "Kenneth Walker III", "walker": "Kenneth Walker III",
        "maye": "Drake Maye", "diggs": "Stefon Diggs", "henry": "Hunter Henry",
        "kupp": "Cooper Kupp", "darnold": "Sam Darnold", "stevenson": "Rhamondre Stevenson",
        "henderson": "TreVeyon Henderson", "barner": "AJ Barner", "charb": "Zach Charbonnet",
        "charbonnet": "Zach Charbonnet", "boutte": "Kayshon Boutte", "hollins": "Mack Hollins",
    }
    if name_lower in nicknames:
        return nicknames[name_lower]
    for player in ALL_PLAYERS.keys():
        if name_lower == player.lower():
            return player
    for player in ALL_PLAYERS.keys():
        if name_lower in player.lower():
            return player
    return None


def execute_tool(tool_name, tool_input):
    """Execute a tool and return results."""
    
    if tool_name == "get_player_stats":
        name = tool_input.get("player_name", "")
        player = find_player(name)
        if not player or player not in ALL_PLAYERS:
            suggestions = [p for p in ALL_PLAYERS.keys() if name.lower()[:3] in p.lower()][:5]
            return f"Player '{name}' not found. Try: {', '.join(suggestions)}"
        
        data = ALL_PLAYERS[player]
        result = f"**{player}** ({data['team']}) - {data['games']} games\n\n"
        result += "**SEASON AVERAGES:**\n"
        if "pass_yds_avg" in data:
            result += f" Passing: {data['pass_yds_avg']} yds/g ({data['pass_yds_total']} total), {data['pass_td_total']} TDs\n"
        if "rush_yds_avg" in data:
            result += f" Rushing: {data['rush_yds_avg']} yds/g ({data['rush_yds_total']} total), {data.get('rush_td_total', 0)} TDs\n"
        if "rec_yds_avg" in data:
            result += f" Receiving: {data['rec_yds_avg']} yds/g ({data['rec_yds_total']} total), {data['rec_avg']} rec/g, {data.get('rec_td_total', 0)} TDs\n"
        if "anytime_td_total" in data:
            result += f"\n**ANYTIME TD:** {data['anytime_td_total']} TDs, {data['games_with_td']}/{data['games']} games ({data['td_hit_rate']}% hit rate)\n"
        if "tackles_avg" in data and data["tackles_avg"] > 1:
            result += f"\n**DEFENSE:** {data['tackles_avg']} tkl/g, {data['sacks_total']} sacks, {data['def_int_total']} INTs\n"
        
        if data.get("logs"):
            result += f"\n**GAME LOG:**\n"
            for g in data["logs"][:10]:
                parts = []
                if "p" in g: parts.append(f"Pass: {g['p']}")
                if "ru" in g: parts.append(f"Rush: {g['ru']}")
                if "rc" in g: parts.append(f"Rec: {g['rc']}")
                if parts:
                    result += f"Wk {g['wk']}: {' | '.join(parts)}\n"
        return result
    
    elif tool_name == "query_player_pbp":
        name = tool_input.get("player_name", "")
        player = find_player(name)
        if not player:
            return f"Player '{name}' not found."
        
        play_type = tool_input.get("play_type", "all")
        down = tool_input.get("down")
        red_zone = tool_input.get("red_zone", False)
        goal_line = tool_input.get("goal_line", False)
        quarter = tool_input.get("quarter")
        situation = tool_input.get("situation")
        
        # Filter plays
        plays = []
        for p in OFFENSIVE_PLAYS:
            # Player match (index 10)
            if player.lower() not in p[10].lower():
                continue
            
            # Play type filter
            if play_type == "pass" and p[7] != 'P':
                continue
            if play_type == "rush" and p[7] != 'R':
                continue
            
            # Down filter (index 2)
            if down and p[2] != down:
                continue
            
            # Red zone (yard_line_100 <= 20, index 4)
            if red_zone and (p[4] > 20 or p[4] <= 0):
                continue
            
            # Goal line (inside 5)
            if goal_line and (p[4] > 5 or p[4] <= 0):
                continue
            
            # Quarter filter (index 1)
            if quarter and p[1] != quarter:
                continue
            
            # Situation filter (score_diff index 6)
            if situation == "trailing" and p[6] >= 0:
                continue
            if situation == "leading" and p[6] <= 0:
                continue
            if situation == "close" and abs(p[6]) > 7:
                continue
            
            plays.append(p)
        
        # Separate pass and rush plays
        pass_plays = [p for p in plays if p[7] == 'P']
        rush_plays = [p for p in plays if p[7] == 'R']
        
        result = f"**{player} - Play-by-Play Analysis**\n\n"
        
        filters = []
        if down: filters.append(f"{down}{'st' if down==1 else 'nd' if down==2 else 'rd' if down==3 else 'th'} down")
        if red_zone: filters.append("red zone")
        if goal_line: filters.append("goal line")
        if quarter: filters.append(f"Q{quarter}")
        if situation: filters.append(situation)
        if filters:
            result += f"**Filters:** {', '.join(filters)}\n\n"
        
        if pass_plays or play_type != "rush":
            catches = [p for p in pass_plays if p[11] == 1]
            result += f"**RECEIVING:**\n"
            result += f" Targets: {len(pass_plays)}\n"
            result += f" Catches: {len(catches)}\n"
            result += f" Yards: {sum(p[8] for p in catches)}\n"
            result += f" TDs: {sum(p[12] for p in catches)}\n"
            if len(pass_plays) > 0:
                result += f" Catch rate: {len(catches)/len(pass_plays)*100:.1f}%\n"
                result += f" Yards/target: {sum(p[8] for p in catches)/len(pass_plays):.1f}\n"
        
        if rush_plays or play_type != "pass":
            result += f"\n**RUSHING:**\n"
            result += f" Carries: {len(rush_plays)}\n"
            result += f" Yards: {sum(p[8] for p in rush_plays)}\n"
            result += f" TDs: {sum(p[12] for p in rush_plays)}\n"
            if len(rush_plays) > 0:
                result += f" YPC: {sum(p[8] for p in rush_plays)/len(rush_plays):.1f}\n"
        
        return result
    
    elif tool_name == "get_player_props":
        prop_type = tool_input.get("prop_type", "all")
        
        # EXCLUDED PLAYERS - Not playing
        EXCLUDED_PLAYERS = ["Zach Charbonnet"]
        
        result = f"**PLAYER PROP BASELINES**\n"
        result += f" EXCLUDED: Zach Charbonnet (NOT PLAYING)\n\n"
        
        if prop_type in ["anytime_td", "all"]:
            result += "**ANYTIME TD (by hit rate):**\n"
            td_players = [(n, d.get('td_hit_rate', 0), d.get('anytime_td_total', 0), d['games'], d['team']) 
                          for n, d in ALL_PLAYERS.items() if d.get('anytime_td_total', 0) > 0 and n not in EXCLUDED_PLAYERS]
            td_players.sort(key=lambda x: x[1], reverse=True)
            for name, rate, tds, games, team in td_players[:12]:
                result += f"  {name} ({team}): {rate}% ({tds} TDs in {games}g)\n"
            result += "\n"
        
        if prop_type in ["rec_yds", "all"]:
            result += "**RECEIVING YARDS (avg/game):**\n"
            rec = [(n, d.get('rec_yds_avg', 0), d['team']) for n, d in ALL_PLAYERS.items() if d.get('rec_yds_avg', 0) > 15 and n not in EXCLUDED_PLAYERS]
            rec.sort(key=lambda x: x[1], reverse=True)
            for name, avg, team in rec[:10]:
                result += f"  {name} ({team}): {avg} yds/g\n"
            result += "\n"
        
        if prop_type in ["rush_yds", "all"]:
            result += "**RUSHING YARDS (avg/game):**\n"
            rush = [(n, d.get('rush_yds_avg', 0), d['team']) for n, d in ALL_PLAYERS.items() if d.get('rush_yds_avg', 0) > 15 and n not in EXCLUDED_PLAYERS]
            rush.sort(key=lambda x: x[1], reverse=True)
            for name, avg, team in rush[:8]:
                result += f"  {name} ({team}): {avg} yds/g\n"
            result += "\n"
        
        if prop_type in ["receptions", "all"]:
            result += "**RECEPTIONS (avg/game):**\n"
            recs = [(n, d.get('rec_avg', 0), d.get('targets_avg', 0), d['team']) for n, d in ALL_PLAYERS.items() if d.get('rec_avg', 0) > 2 and n not in EXCLUDED_PLAYERS]
            recs.sort(key=lambda x: x[1], reverse=True)
            for name, rec_avg, tgt_avg, team in recs[:10]:
                result += f"  {name} ({team}): {rec_avg} rec/g ({tgt_avg} tgt/g)\n"
        
        return result
    
    elif tool_name == "get_team_tendencies":
        team = tool_input.get("team", "seahawks")
        situation = tool_input.get("situation", "all")
        team_code = "SEA" if "sea" in team.lower() else "NE"
        plays = [p for p in OFFENSIVE_PLAYS if p[5] == team_code]
        
        def calc(pl):
            r = sum(1 for p in pl if p[7] == 'R')
            ps = sum(1 for p in pl if p[7] == 'P')
            t = r + ps
            return f"{r} runs ({r/t*100:.1f}%) vs {ps} passes ({ps/t*100:.1f}%)" if t > 0 else "No plays"
        
        result = f"**{team_code} TENDENCIES**\n\n"
        if situation in ["all", "1st_down"]:
            result += f"**1st Down:** {calc([p for p in plays if p[2]==1])}\n"
        if situation in ["all", "3rd_down"]:
            result += f"**3rd Down:** {calc([p for p in plays if p[2]==3])}\n"
            result += f"   3rd & Short: {calc([p for p in plays if p[2]==3 and p[3]<=3])}\n"
            result += f"   3rd & Long: {calc([p for p in plays if p[2]==3 and p[3]>=7])}\n"
        if situation in ["all", "red_zone"]:
            result += f"**Red Zone:** {calc([p for p in plays if 0<p[4]<=20])}\n"
        return result
    
    elif tool_name == "get_betting_trends":
        cat = tool_input.get("category", "all")
        t = SUPER_BOWL_TRENDS
