# ============================================
# HTTP HANDLER
# ============================================

class handler(BaseHTTPRequestHandler):
    def do_OPTIONS(self):
        self.send_response(200)
        self.send_header('Access-Control-Allow-Origin', '*')
        self.send_header('Access-Control-Allow-Methods', 'POST, OPTIONS')
        self.send_header('Access-Control-Allow-Headers', 'Content-Type')
        self.end_headers()
    
    def do_POST(self):
        self.send_response(200)
        self.send_header('Content-Type', 'application/json')
        self.send_header('Access-Control-Allow-Origin', '*')
        self.end_headers()
        
        try:
            content_length = int(self.headers.get('Content-Length', 0))
            body = self.rfile.read(content_length)
            data = json.loads(body)
            
            user_message = data.get('message', '')
            history = data.get('history', [])
            
            if not user_message:
                self.wfile.write(json.dumps({"error": "No message"}).encode())
                return
            
            api_key = os.environ.get("ANTHROPIC_API_KEY")
            if not api_key:
                self.wfile.write(json.dumps({"error": "No API key"}).encode())
                return
            
            client = anthropic.Anthropic(api_key=api_key)
            messages = [{"role": h["role"], "content": h["content"]} for h in history[-10:]]
            messages.append({"role": "user", "content": user_message})
            
            response = client.messages.create(
                model="claude-sonnet-4-20250514",
                max_tokens=2048,
                system=build_system_prompt(),
                tools=TOOLS,
                messages=messages
            )
            
            final_text = ""
            while response.stop_reason == "tool_use":
                tool_results = []
                for block in response.content:
                    if block.type == "tool_use":
                        result = execute_tool(block.name, block.input)
                        tool_results.append({"type": "tool_result", "tool_use_id": block.id, "content": result})
                    elif block.type == "text":
                        final_text += block.text
                
                messages.append({"role": "assistant", "content": response.content})
                messages.append({"role": "user", "content": tool_results})
                
                response = client.messages.create(
                    model="claude-sonnet-4-20250514",
                    max_tokens=2048,
                    system=build_system_prompt(),
                    tools=TOOLS,
                    messages=messages
                )
            
            for block in response.content:
                if block.type == "text":
                    final_text += block.text
            
            self.wfile.write(json.dumps({"response": final_text, "success": True}).encode())
            
        except Exception as e:
            self.wfile.write(json.dumps({"error": str(e), "success": False}).encode())
